import React, {useState} from "react";
import {Link} from "react-router-dom";
import "../styles/Login.css"

const Login = () => {
    const [loginData, setLoginData] = useState({email: '', password: ''})

    const showLoginData = (event) => {
        event.preventDefult();
        const Data = {...loginData}
        console.log(event);
        setLoginData({login: '', password: ''});
    }     

    return (
        <div className="authPage">
            <div className="authForm">
                <form>
                    <div class="mb-3">
                        <label for="exampleInputEmail1" class="form-label">Email адрес</label>
                        <input 
                            type="email" 
                            class="form-control" 
                            id="exampleInputEmail1" 
                            aria-describedby="emailHelp"
                            value={loginData.email}
                            onChange={event => setLoginData({...loginData, email: event.target.value})}
                        />
                        <div id="emailHelp" class="form-text">Мы никогда не делимся Вашим адресом.</div>
                    </div>
                    <div class="mb-3">
                        <label for="exampleInputPassword1" class="form-label">Пароль</label>
                        <input 
                            type="password" 
                            class="form-control" 
                            id="exampleInputPassword1"
                            value={loginData.password}
                            onChange={event => setLoginData({...loginData, password: event.target.value})}
                        />
                    </div>
                    <div class="mb-3 form-check">
                        <Link to="/registration" style={{ textDecoration: 'none' }}>
                            <p class="link-dark">Нет аккаунта?</p>
                        </Link>
                    </div>
                    <div class="mb-3 form-check">
                        <Link to="/recovery_password" style={{ textDecoration: 'none' }}>
                            <p class="link-dark">Забыли пароль?</p>
                        </Link>
                    </div>
                    <button 
                        type="submit" 
                        class="btn btn-primary"
                        onClick={showLoginData}
                    >
                        Войти
                    </button>
                </form>
            </div>
        </div>
    );
};

export default Login;
